  const { user } = useContext(Context);
  return (
    <>
      <Routes>
        {nav.map((r, i) => {
          if (r.isPrivate && auth) {
            return <Route key={i} path={r.path} element={r.element} />;
          } else if (!r.isPrivate) {
            return <Route key={i} path={r.path} element={r.element} />;
          } else return false;
        })}
      </Routes>
    </>
